import React from "react";

// 아이디 찾기 페이지
const FindId = () => {
  return (
    <div>
      <h2>아이디 찾기</h2>
      <p>가입하신 이메일 또는 휴대폰 번호로 아이디를 찾을 수 있습니다.</p>
    </div>
  );
};

export default FindId;
